package com.sina.parkingApplication.model;import com.sina.parkingApplication.common.BaseEntity;import lombok.Data;import lombok.EqualsAndHashCode;import lombok.ToString;import org.hibernate.envers.Audited;import javax.persistence.*;import java.util.List;@Entity@Data@Table(name = Vehicle.VEHICLE_TBL)@Auditedpublic class Vehicle extends BaseEntity {    public static final String VEHICLE_TBL = "vehicle_tbl";    @Column(unique = true)    private String plateNumber;    @Enumerated(value = EnumType.STRING)    private CarClass carClass;    @ToString.Exclude    @EqualsAndHashCode.Exclude    @OneToMany(mappedBy = "vehicle", fetch = FetchType.LAZY, cascade = CascadeType.ALL)    private List<ParkingDetail> parkingDetail;}